// Default imports
import React, {Component} from 'react';

// Custom imports
import Nav from '../navbar/navbar';
import {connect} from 'react-redux';
import * as personalInfo from '../../actions/personalinfo';
import {GoMail, GoMarkGithub} from 'react-icons/go';

class Contact extends Component {
    render() {
        const {firstName, lastName, email, gitProfileLink, linkedInLink} = this.props.personalInfo;
        return (
            // HTML here
            <div>
                <Nav/>
                <div className='container'>
                    <a href={email} className='black-text'><GoMail/> • {email}</a>
                    <br/>
                    <span><GoMarkGithub/> • {gitProfileLink}</span>
                </div>
            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return state
};

// Default export
export default connect(mapStateToProps, personalInfo)(Contact);
